window.bookSummaryJSON = "<p>Something called the “Blue Juice\" is coming. For all of us.&nbsp;</p> <p>Luckily, me (Chip Collins), Pete, Nikola Tesla, Bobo, and FBI Agent Gina Phillips are here to kick its ass, and send it back to last Tuesday. Maybe. Or maybe we'll fail, and everyone in the multiverse is doomed. (Seriously, you might want to get that underground bunker ready.) Either way, I've got to get home to Julie and find out – woah, I'm not about to tell you that right here in the book description! TMI, dude.&nbsp;</p> <p><b>WARNING</b>: If you haven't heard Where the Hell is Tesla?, I apologize in advance, as you might get completely freaking lost. If you do, just call my apartment, I'm usually around, and I'll fill you in. (If I'm not stuck in the ITA.) – Chip&nbsp;</p>"; 
